pragma solidity >=0.4.22 <0.7.0;

import "@openzeppelin/contracts/lifecycle/Pausable.sol";
import "@openzeppelin/contracts/ownership/Ownable.sol";
import "./interfaces/ConvertStrategy.sol";

contract Converter is Pausable, Ownable {

    enum Stage { Deployed, Claim, Transfer, Finished }

    Stage public currentStage = Stage.Deployed;

    ConvertStrategy public convertStrategy;

    uint256 public deployTimestamp;
    uint256 public finishDelay;

    uint256 public minTransferAmount;

    event NextStage(address _sender, Stage _currentStatus, uint256 _timestamp);
    event ConvertStrategyChanged(address _sender, address _from, address _to, uint256 _timestamp);
    event Convert(Stage _stage, address _from, string _eosAccName, string _eosOpenKey, uint256 _amount, uint256 _timestamp);

    /// @dev modifier that allow to call function if current stage is bigger than specified
    modifier stageAfter(Stage _stage) {
        require(uint256(currentStage) > uint256(_stage));
        _;
    }

    /// @dev modifier that allow to call function if current stage is less than specified
    modifier stageBefore(Stage _stage) {
        require(uint256(currentStage) < uint256(_stage));
        _;
    }

    constructor(uint256 _finishDelay, uint256 _minTransferAmount) public {
        deployTimestamp = now;
        finishDelay = _finishDelay;
        minTransferAmount = _minTransferAmount;
    }

    /// @dev function that call specified convert strategy to convert tokens
    function convert(string memory openKey, string memory eosAccName, uint256 amount)
    whenNotPaused
    stageAfter(Stage.Deployed)
    stageBefore(Stage.Finished)
    public {
        // can not convert less that minimum amount
        require(amount >= minTransferAmount);

        // round tokens amount to 4 decimals
        uint256 intValue = amount / (10**14);
        uint256 roundedValue = intValue * (10**14);

        convertStrategy.convert(msg.sender, openKey, eosAccName, roundedValue);

        emit Convert(currentStage, msg.sender, eosAccName, openKey, roundedValue, now);
    }

    function nextStage() whenNotPaused onlyOwner stageBefore(Stage.Finished) public {
        // move to next stage
        uint256 next = uint256(currentStage) + 1;
        currentStage = Stage(next);

//        if (currentStage == Stage.Finished) {
//            // can be finished after delay expired
//            uint256 timeDiff = now - deployTimestamp;
//            require(timeDiff >= finishDelay);
//        }

        emit NextStage(msg.sender, currentStage, now);
    }

    function setConvertStrategy(ConvertStrategy _convertStrategy) onlyOwner public {
        address from = address(convertStrategy);
        convertStrategy = _convertStrategy;

        emit ConvertStrategyChanged(msg.sender, from, address(_convertStrategy), now);
    }
}
